import React, { useEffect } from 'react';
//import { Link, withRouter } from 'react-router-dom';
import { getNyc } from '../actions/getNyc';
import { getGaurdian } from '../actions/getGaurdian';
import { connect } from 'react-redux';
import PropTypes from 'prop-types';
import DataCard from './DataCard';

const DataView = ({ getNyc, getGaurdian, data }) => {
	useEffect(() => {
		getNyc();
	}, [getNyc]);
	useEffect(() => {
		getGaurdian();
	}, [getGaurdian]);

	return <DataCard />;
};

DataView.propTypes = {
	getNyc: PropTypes.function.isRequired,
	getGaurdian: PropTypes.function.isRequired
};
const mapStateToProps = state => ({
	nycData: state.nycData,
	gaurdianData: state.gaurdianData
});

export default connect(mapStateToProps, { getNyc, getGaurdian })(DataView);
